import React from 'react';
import { Header, Icon, Player, Embed } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            {/* <div> */}
                {/* <video
                    autoPlay
                    loop
                    muted
                    style={{
                        position: "absolute",
                        width: "100%",
                        objectFit: "cover",
                        transform: "translate(-50%,-10%)"
                    }}
                >
                    <source src={Vikings} type="video/mp4" />
                </video> */}
            {/* </div> */}
            <Embed
                autoplay={true}
                color='white'
                hd={false}
                id='gJscrxxl_Bg'
                iframe={{
                    allowFullScreen: true,
                    style: {
                        padding: 10,
                    },
                }}
                placeholder='/images/image-16by9.png'
                source='Vikings'
            />
            <div>dsfsdfsdfsd</div>
        </React.Fragment>
    )
}

export default HeaderPart;
